import React, { useEffect } from 'react'
import {
  BrowserRouter,
  Routes,
  Route,
  Navigate,
  useNavigate
} from 'react-router-dom';
import {v4 as uuidV4} from 'uuid';

import TextEditor from './TextEditor';

function App() {
  const navigate = useNavigate();

  useEffect(() => {
    navigate(`/documents/${uuidV4()}`)
  }, [])

  return (
    <div>
      <BrowserRouter>
        <Routes>
          {/* <Route path="/" exact>
            <Navigate to={`/documents/${uuidV4()}`} />
          </Route> */}
          <Route path="/documents/:id">
            <TextEditor />
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
